$(document).ready(function(){for(var s=document.querySelectorAll(".nav-tab"),c=document.querySelectorAll(".tab-pane"),i=document.querySelectorAll(".table"),l=document.querySelectorAll(".col_title"),t=0;t<s.length;t++)s[t].addEventListener("mouseover",function(t){t.preventDefault();for(var e=t.target.getAttribute("data-tab"),a=0;a<s.length;a++){e===c[a].getAttribute("data-tab-content")?(s[a].classList.add("active"),c[a].classList.add("active"),i[a].classList.add("active"),i[a].classList.add("fadeInRight"),l[a].classList.add("active")):(s[a].classList.remove("active"),c[a].classList.remove("active"),i[a].classList.remove("active"),i[a].classList.remove("fadeInRight"),l[a].classList.remove("active"))}});for(t=0;t<s.length;t++)s[t].addEventListener("click",function(t){t.preventDefault();for(var e=t.target.getAttribute("data-tab"),a=0;a<s.length;a++){e===c[a].getAttribute("data-tab-content")?(s[a].classList.add("active"),c[a].classList.add("active"),i[a].classList.add("active"),l[a].classList.add("active")):(s[a].classList.remove("active"),c[a].classList.remove("active"),i[a].classList.remove("active"),l[a].classList.remove("active"))}})});